import React from 'react'
import MoneyChart from '../../components/money/MoneyChart'
import './MoneyPage.css'

const Money = () => {
  return (
    <div className='money-page'>
        <MoneyChart days={7}/>
        <MoneyChart days={15}/>
        <MoneyChart days={30}/>
    </div>
  )
}

export default Money
